import styled from "styled-components";

export const Container = styled.div`
  background-color: red;
  color: #fff;
  width: 100%;
  height: 60px;
  padding: 0 50px;

  ul {
    height: 100%;
    display: flex;
    align-items: center;
    list-style: none;
    gap: 20px;
  }
`;
